import React from "react";

import "./App.css";

function App() {
  return (
    <div className="container">
      <div className="gifs">
        <div className="gif 1">
          <img src={require("../public/gifs/1.gif")} alt="rain" />
        </div>
        <div className="gif 1"></div>
        <div className="gif 1"></div>
      </div>
    </div>
  );
}

export default App;
